import Modal from "react-modal";
import {useState} from 'react';
import './Inscription.css';

const Inscription = () => {
    const [modalIsOpen, setmodalIsOpen] = useState(false)
    return (
        <>
            <button>Open modal</button>
            <Modal>
                Fancy Modal
            </Modal>
        </>
    )
}

export default Inscription;
